I'm not sure if this is exactly what you're looking for, but I've created a simple class that can be used to stack multiple images on top of each other.

```
class StackedImages {
    private var images: [UIImage] = []
    private var imageViews: [UIImageView] = []

    init(images: [UIImage]) {
        self.images = images
        for image in images {
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageViews.append(imageView)
        }
    }

    func stackImages() {
        for (index, imageView) in imageViews.enumerated() {
            imageView.frame = CGRect(x: 0, y: CGFloat(index) * imageView.frame.height, width: imageView.frame.width, height: imageView.frame.height)
        }
    }

    func addToView(view: UIView) {
        for imageView in imageViews {
            view.addSubview(imageView)
        }
        stackImages()
    }
}
```

To use this class, you can create an instance of it with an array of images, and then call the `addToView` method to add the stacked images to a view.

```
let images = [UIImage(named: "image1"), UIImage(named: "image2"), UIImage(named: "image3")]
let stackedImages = StackedImages(images: images)
stackedImages.addToView(view: myView)
```

This will add the stacked images to the `myView` view, with the first image at the top and the last image at the bottom.

Note that this is a very simple implementation and may not be suitable for all use cases. You may need to modify the class to fit your specific needs.

